description:
In 2015, the Department of Health introduced the Modified Monash Model (MMM) classification system as it better targets health workforce programs by categorising metropolitan, regional, rural and remote areas according to both geographical remoteness, as defined by the Australian Bureau of Statistics, and town size. The MMM 2019 was updated on 1 July 2019 to use the latest available Australian Bureau of Statistics (2016) Census data and geography information. Health programs will begin transitioning to the new MMM from 1 January 2020.
The 2019 MMM uses the following data sets: 
•	Australian Statistical Geography Standard 2016 Statistical Area 1; and Urban Centres and Localities as the geographic bases; 
•	Australian Statistical Geography Standard – Remoteness Area 2016 as the ABS remoteness classification (based on Accessibility and Remoteness Index of Australia (ARIA+); 
•	Estimated Resident Population 2016; and 
•	Public Sector Mapping Agency 2018 Australian road network.
